#-------------------------------------Part One-----------------------------------------------

numOfSafeReports = 0  #will tally-up for the answer
for listStr in cleanInput: #looking at each item from original input as a list in-and-of itself
    listOfLevels = []
    tempChar = ""
    for char in listStr:
        if char == " ":  #if the character IS a space
            listOfLevels.append(int(tempChar)) #add a full number to the array
            tempChar = ""
        else:        #if the character is NOT a space
            tempChar += (char)
    listOfLevels.append(int(tempChar)) #adds the last one (there's no space to trigger it)
    #print (listOfLevels)
    #---------now we have an array of levels (the single and double digit numbers)---------------
    isStillSafe = True
    isIncreasing = True
    if listOfLevels[1] < listOfLevels[0]:  # if lvl is DECREASING in this list  <<<<
        for n in range(1, len(listOfLevels)):
            lvl = listOfLevels[n]  #just here to beautify
            prelvl = listOfLevels[n-1] #also here to beautify
            if lvl - prelvl > -1  or  lvl - prelvl < -3: #check to determine if diff is increasing or out-of-bounds
                isStillSafe = False
                print('Unsafe: Out of Bounds - - ' + str(listOfLevels))
                break
    elif listOfLevels[1] > listOfLevels[0]: # if lvl is INCREASING in this list  <<<<
        for n in range(1, len(listOfLevels)):
            lvl = listOfLevels[n]  #just here to beautify
            prelvl = listOfLevels[n-1] #also here to beautify
            if lvl - prelvl < 1  or  lvl - prelvl > 3: #check to determine if diff is decreasing or out-of-bounds
                isStillSafe = False
                print('Unsafe: Out of Bounds - - ' + str(listOfLevels))
                break
    elif listOfLevels[1] == listOfLevels[0]:
        isStillSafe = False
        print('Unsafe: Equal - - - - - - ' + str(listOfLevels))
    else:
        print('Error: conditional not fulfilled')
    if isStillSafe == True: #should only be true if the list increased OR decreased by a difference of 1 to 3
        numOfSafeReports += 1
